import avatar from "../../assets/avatar.jpg";
import {
  CommentIcon,
  EmojiIcon,
  LikeIcon,
  MoreIcon,
  SaveIcon,
  ShareIcon,
} from "../../assets/icons/icons";
import { db } from "../../utils/firebase";
import { createUser } from "../../firebase/createUser";
import "./Post.scss";
import { useState } from "react";

export const Post = ({
  username,
  profilePic,
  media,
  likeCount,
  commentCount,
  description,
}) => {
  const [comment, setComment] = useState("");
  const handleSubmit = (e) => {
    e.preventDefault();
    createUser(db);
  };

  return (
    <div className="Post">
      <div className="top">
        <div className="avatar-container">
          <img src={profilePic} className="avatar" alt="profile-picture"></img>
        </div>
        <div className="username-container">
          <a href="#" className="username">
            {username}
          </a>
        </div>
        <MoreIcon />
      </div>
      <div className="media-container">
        <img src={media} className="media" alt="post"></img>
      </div>
      <div className="buttons-container">
        <LikeIcon />
        <CommentIcon />
        <ShareIcon />
        <span></span>
        <SaveIcon />
      </div>
      <div className="likes-container">
        <div className="liked-by-avatar">
          <a href="#">
            <img src={avatar} className="avatar" alt="profile-picture"></img>
          </a>
        </div>
        <div className="likes-text">
          Liked by <a href="#">vefa.ozlu</a> and
          <a href="#">{likeCount} others</a>
        </div>
      </div>
      <div className="content">
        <div className="text">
          <a href="#" className="post-user">
            vefa.ozlu
          </a>
          {description}
        </div>
        <a href="#">more</a>
        <span></span>
        <a href="#">View all {commentCount} comments</a>
      </div>
      <div className="shared-date">
        <a href="#">1 hour ago</a>
      </div>
      <div className="comment-container">
        <form onSubmit={handleSubmit}>
          <input
            type="text"
            value={comment}
            onChange={(e) => setComment(e.target.value)}
          />
          <input type="submit" />
        </form>

        {/*         <EmojiIcon />
        <div className="input-container">
          <div className="placeholder">Add a comment...</div>
        </div>
        <a href="#">Post</a> */}
      </div>
    </div>
  );
};

function Posts({ posts }) {
  return (
    <div className="Posts">
      {posts.map((post, index) => (
        <div key={index}>{post}</div>
      ))}
    </div>
  );
}

export default Posts;
